function Pessoa ({nome, idade}) {
    return (
        <> 
            <h1 className={styles.pessoaContent}>Olá, seu nome é {nome}</h1>
            <p className={styles.pessoaContent}>Você possui {idade} anos, certo?</p>
        </>
    )
    
}

export default Pessoa
